import AppointmentCard from '../components/AppointmentCard';

export default function AppointmentsPage() {
  const mockAppointments = [
    { patient: 'John Doe', date: 'Nov 10, 2025', time: '10:00 AM', status: 'Confirmed' },
    { patient: 'Jane Smith', date: 'Nov 11, 2025', time: '2:30 PM', status: 'Pending' },
    { patient: 'Ali Mwangi', date: 'Nov 12, 2025', time: '9:15 AM', status: 'Completed' },
  ];

  return (
    <div>
      <h2>Appointments</h2>
      {mockAppointments.map((appt, index) => (
        <AppointmentCard
          key={index}
          patient={appt.patient}
          date={appt.date}
          time={appt.time}
          status={appt.status}
        />
      ))}
    </div>
  );
}
